const App = (userId) => {
   const [count,SetCount]=useState()
   let x;
   const user = useSelector(state => (state.userId));
   axios.get(`http://localhost:8080/api/bay/${user}`).then((data) =>{
   x = data.data;
  })
  return<>
  {x.map((data)=>{
   <p>{data.Name}</p>,
   <label>count:</label>,
   <p>{data.Count}</p>,
   <button onClick={()=>{SetCount(count-1);
      alert("-1$")}}>-</button>,
   <button onClick={SetCount(count-1)}>+</button>
  })}
  
  </>
}
